// Imports
    // Librarys
import React from "react";
// Styles
import './styles/buttonStyle.css';

// Component
const Button = ({text, nameClass, click}) => {
    return(
        <React.Fragment>
            <button className={nameClass} onClick={click}> {text} </button>
        </React.Fragment>
    );
}

// Exports
export {Button};
